# test_valid_request.py
import requests
import json

# Valid base64 for a 1x1 black pixel PNG
valid_image_b64 = ""

payload = {
    "image_base64": f"data:image/png;base64,{valid_image_b64}",
    "filter": {
        "type": "box_blur",
        "mask_size": 3
    },
    "cuda_config": {
        "block_dim": [8, 8],
        "grid_dim": [8, 8]
    }
}

try:
    response = requests.post("http://127.0.0.1:5000/convolve", json=payload)
    print(f"Status Code: {response.status_code}")
    print(f"Response: {response.json()}")
except Exception as e:
    print(f"Error: {e}")